import {Tontine} from "./Abstracts/Tontine";
import {Vente} from "./Entitys/Vente";
import {Simple} from "./Entitys/Simple";

class TontineFactory{

    constructor() {
    }

    public build(tontine:Tontine){

        if (tontine.type.code===1)
            return new Vente(tontine.id,tontine.actif,tontine.nom,tontine.type,tontine.tauxTontine,tontine.tauxEchec,tontine.tauxRetard,tontine.frequence,tontine.createdAt,tontine.updatedAt,tontine.nbSeances,tontine.tauxEchecB);
        else
            return new Simple(tontine.id,tontine.actif,tontine.nom,tontine.type,tontine.tauxTontine,tontine.tauxEchec,Number(tontine.tauxEchecB),tontine.tauxRetard,tontine.frequence,tontine.createdAt,tontine.updatedAt,tontine.nbSeances);

    }
}
